{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"cell_type":"markdown","source":"**INTRODUCTION**\n\nThis is the case study done by me for the Cyclistic Bike-Share firm. The case study is done as a part of Google's Data Analytics Capstone Project. \n\n**SCENARIO**\n\nYou are a junior data analyst working in the marketing analyst team at Cyclistic, a bike-share company in Chicago. The director of marketing believes the company’s future success depends on maximizing the number of annual memberships. Therefore, your team wants to understand how casual riders and annual members use Cyclistic bikes differently. From these insights, your team will design a new marketing strategy to convert casual riders into annual members. But first, Cyclistic executives must approve your recommendations, so they must be backed up with compelling data insights and professional data visualizations.\n\n**CHARACTERS AND TEAMS**\n\n**Cyclistic**: A bike-share program that features more than 5,800 bicycles and 600 docking stations. Cyclistic sets itself apart by also offering reclining bikes, hand tricycles, and cargo bikes, making bike-share more inclusive to people with disabilities and riders who can’t use a standard two-wheeled bike. The majority of riders opt for traditional bikes; about 8% of riders use the assistive options. Cyclistic users are more likely to ride for leisure, but about 30% use them to commute to work each day.\n\n**Lily Moreno**: The director of marketing and your manager. Moreno is responsible for the development of campaigns and initiatives to promote the bike-share program. These may include email, social media, and other channels.\n\n**Cyclistic marketing analytics team**: A team of data analysts who are responsible for collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy. You joined this team six months ago and have been busy learning about Cyclistic’s mission and business goals — as well as how you, as a junior data analyst, can help Cyclistic achieve them.\n\n**Cyclistic executive team**: The notoriously detail-oriented executive team will decide whether to approve the recommended marketing program.\n\n","metadata":{}},{"cell_type":"markdown","source":"","metadata":{}},{"cell_type":"markdown","source":"**CASE STUDY PHASE - *ASK***\n\n**Guiding Questions**\n\n* **What is the problem you are trying to solve?**\n\nWe are simply trying to find the answer to the question How do annual members and casual riders use Cyclistic bikes differently? \n\nThe main goal of the company is to convert maximum number of casual customers to annual members and thus, increase the profits. In order to achieve this, we need to design marketing strategies aimed for the conversion mentioned before. For this, we first need to understand the fundamental differences between annual members and casual riders.\n\nAs a junior analyst, it is my task to get insights for the objective from the available data.\n\n* **How can your insights drive business decisions?**\n\nMy insights will serve as a helping hand for the marketing team for designing the further marketing strategies and for the tactics that will be undertaken for achieving the goal.\n\n**Key Tasks**\n\n1. **Identify the business task**\n\nThe business is to increase the profits of the firm by maximizing the number of annual members and in particular to convert the casual riders into annual members.\n\n2. **Consider the Key Stakeholders**\n\nMy key stateholders will be *Lily Moreno* and the* Cyclistic Executive Team*\n\n**Deliverable**\n\n* **A clear statement of the business task**\n\nThe business task is to find the fundamental differences between the casual riders and the annual members.","metadata":{}},{"cell_type":"markdown","source":"**CASE STUDY PHASE - *PREPARE***\n\n**Guiding Questions**\n\n* **Where is your data located?**\n\nThe data is located in the kaggle dataset.\nAlso, one can find the dataset on the following link : \nhttps://divvy-tripdata.s3.amazonaws.com/index.html\n\n* **How is the data organized?**\n\nThe data is in .csv format.\nThe data is well organized with proper meta-data for each column.\n\n* **Are there issues with bias or credibility in this data?**\n\nThere is no issue of the bias or credibility as the data is generated by the company itself from their customers.\n\nThe data with us is Reliable, Original, Comprehensive, Current, Cited (ROCCC).\n\n* **How are you addressing licensing, privacy, security, and accessibility?**\n\nYes, I am adreesing them all.\n\n* **How did you verify the data’s integrity?**\n\nTalking about the integrity of the data, all the files have consistent data, alongwith same columns and all columns have the correct data type.\n\n* **How does it help you answer your question?**\n\nTo find the anwer of my question, certain necessary data is needed and the dataset provided contains all of them. Though, certain operations and addition of columns need to be done but overall the data is helping me as most of the constraints are satisfied.\n\n* **Are there any problems with the data?**\n\nThe most common problem with data is that it is not updated, still it is latest enough to get the insights but strong updated data is always better,\nAlso, more the data more ground to explore.\nAs discussed earlier, no major cleaning is required in the data but certain addition need to be done.\n\n\n**Key Tasks**\n1. Download data and store it appropriately.\n2. Identify how it’s organized.\n3. Sort and filter the data.\n4. Determine the credibility of the data.\n\n**Deliverable**\n\n**A description of all data sources used**\n\nThe main data-source is the data provided by the company itself.\n\n","metadata":{}},{"cell_type":"markdown","source":"**CASE STUDY PHASE - *PROCESS***\n\nIn this phase, we prepare the data for the further analysis.\n\n*Guiding Questions*\n\n* **What tools are you choosing and why?**\n\nI am choosing R. The reason is pretty simple, as the dataset is very large, so it is better to use a programming language as they handle it very well.\nWe can still use sheets but it will tiresome.\n\nNote: Python can also be used instead of R.\n\n","metadata":{}},{"cell_type":"markdown","source":"","metadata":{}},{"cell_type":"code","source":"#IMPORTING AND LOADING THE tidyverse PACKAGE.\n\nlibrary(tidyverse)\n","metadata":{"execution":{"iopub.status.busy":"2022-03-24T06:32:55.146132Z","iopub.execute_input":"2022-03-24T06:32:55.148051Z","iopub.status.idle":"2022-03-24T06:32:56.380696Z"},"trusted":true},"execution_count":1,"outputs":[{"name":"stderr","text":"── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n\n\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.5     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.7\n\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.0.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n\n── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n\n","output_type":"stream"}]},{"cell_type":"markdown","source":"","metadata":{}},{"cell_type":"markdown","source":"**AS THERE ARE MULTIPLE CSV FILES, SO WE NEED TO CONCATENATE THEM AND THEN, TO WE NEED TO MAKE DATAFRAME**","metadata":{}},{"cell_type":"code","source":"csv_files <- list.files