kslash{}\\%] 156450.4\n\\end{description*}\n","text/plain":"           0%            5%           10%           15%           20% \n-29049.966667      3.033333      4.400000      5.516667      6.566667 \n          25%           30%           35%           40%           45% \n     7.633333      8.750000      9.916667     11.166667     12.533333 \n          50%           55%           60%           65%           70% \n    14.066667     15.783333     17.750000     20.050000     22.733333 \n          75%           80%           85%           90%           95% \n    25.933333     29.816667     35.433333     44.750000     71.233333 \n         100% \n156450.400000 "},"metadata":{}}]},{"cell_type":"markdown","source":"**IT IS CLEAR FROM THE ABOVE :\nThe difference between 5% and 95% is 69.95 minutes. Because of that, in the analysis of this variable we are going to use a subset of the dataset without outliners. The subset will contain 95% of the dataset.**","metadata":{}},{"cell_type":"code","source":"cyclistic_without_outliers_df <- final_cyclistic_df %>% \n    filter(ride_time > as.numeric(ventiles['5%'])) %>%\n    filter(ride_time < as.numeric(ventiles['95%']))","metadata":{"execution":{"iopub.status.busy":"2022-03-24T06:36:28.193642Z","iopub.execute_input":"2022-03-24T06:36:28.194895Z","iopub.status.idle":"2022-03-24T06:36:29.148220Z"},"trusted":true},"execution_count":23,"outputs":[]},{"cell_type":"code","source":"cyclistic_without_outliers_df %>% \n    group_by(member_casual) %>% \nsummarise(mean=mean(ride_time))","metadata":{"execution":{"iopub.status.busy":"2022-03-24T06:36:29.151801Z","iopub.execute_input":"2022-03-24T06:36:29.153431Z","iopub.status.idle":"2022-03-24T06:36:29.264217Z"},"trusted":true},"execution_count":24,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 2 × 2</caption>\n<thead>\n\t<tr><th scope=col>member_casual</th><th scope=col>mean</th></tr>\n\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>casual</td><td>23.62913</td></tr>\n\t<tr><td>member</td><td>15.00468</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA tibble: 2 × 2\n\n| member_casual &lt;chr&gt; | mean &lt;dbl&gt; |\n|---|---|\n| casual | 23.62913 |\n| member | 15.00468 |\n\n","text/latex":"A tibble: 2 × 2\n\\begin{tabular}{ll}\n member\\_casual & mean\\\\\n <chr> & <dbl>\\\\\n\\hline\n\t casual & 23.62913\\\\\n\t member & 15.00468\\\\\n\\end{tabular}\n","text/plain":"  member_casual mean    \n1 casual        23.62913\n2 member        15.00468"},"metadata":{}}]},{"cell_type":"markdown","source":"**IT IS CLEAR THAT AVERAGE RIDE TIME OF CASUAL RIDERS IS MORE COMPARED TO MEMBERS**","metadata":{}},{"cell_type":"markdown","source":"**Guiding Question**\n\n* **How should you organize your data to perform analysis on it?**\nThe data should be organized in a well formatted and cleaned .csv file in order to perform the proper analysis\n\n* **Has your data been properly formatted?**\nYes, the data is properly formatted\n\n* **What surprises did you discover in the data?**\n1. The casual members have more average ride time.\n2. The casual members almost equaled the annual members on saturdays.\n3. The docked bike is still most preferred even more than electric bike.\n\n* **What trends or relationships did you find in the data?**\n    * There are more annual members than casual riders using the bikes\n    * The average ride time of casual riders is more comapred to annual members.\n    * The number of casual riders increases on week-ends compared to week-days.\n    * The evening rush hour especially the 5 pm has the most number of users during the    entire day. Which means there is a health and fitness aspect that needs to be considered,\n    * The docked bike is still most preferred \n         ","metadata":{}},{"cell_type":"markdown","source":"**CASE STUDY PHASE - *SHARE***\n\n**Guiding Questions**\n\n* **Were you able to answer the question of how annual members and casual riders use Cyclistic bikes differently?**\n\nYes, I was able to answer the question.\n\n* **What story does your data tell?**\n\nThe story my data tells is very simple. There is clear cut relation between the week-ends and the number of casual rider and also, with the health and fitness mentality.\n\n* **Who is your audience? What is the best way to communicate with them?**\n\nMy audience will be the executive team and my manager Lily and also the marketing team. The best way to communicate with them is to organize a group meeting and present the insights in the form of presentation.\n\n* **Can data visualization help you share your findings?**\n\nYes, of course","metadata":{}},{"cell_type":"markdown","source":"**CASE STUDY PHASE - *ACT***\n\n***CONCLUSION***\n\n* Members have bigger share on weekdays while casual riders take on weekends.\n* We have more members during the morning, mainly between 5am and 11am. And more casuals between 11pm and 4am.\n* Both groups have high preference for the docked bikes or classic bikes.\n* Casuals have more riding time than members\n* Riding time for members keeps unchanged during the midweek, increasing during weekends.\n\n**Also, we can say that most of the annual members have a fixed use of the bikes like for commuting or for exercise, while casual riders have more diverse uses like commuting, exercise, to go free roam, as a leisure activity on weekends or as an alternative mode of transport for temporary basis**\n\n**Guiding Question**\n\n* **What is your final conclusion based on your analysis?**\nBoth the members and riders use the bikes for different purpose.\n\n* **How could your team and business apply your insights?**\nInsights can be used while preparing the marketing campaign for luring casual riders to become members. The campaign can have focus on bike sharing program as an excellent and green way of commuting and also fitness angle can be considered.\n\n\n","metadata":{}},{"cell_type":"markdown","source":"","metadata":{}}]}